import axios from 'axios';

async function fantasyapiRetrive() {
    const response = await axios.get('http://https://fantasy-api.formula1.com/partner_games/f1/players#/fantasyapi-players/retrieve');
    console.log(response);
}

export default fantasyapiRetrive;
